    the name, address, occupation and employer of individuals whose contributions
    exceed $200 in a calendar year. In the spirit of transparency, the VDP has chosen
    to disclose all of our donors, whether or not their contributions aggregate to
    $200 in a calendar year. The VDP may continue to report unitemized contributions
    from our joint fundraising partners with Dollars for Democrats and the DNC State
    Party Victory Fund. --------- Please be advised that the salaries and payroll
    taxes reported on Schedule H4 were for employees who spent 25% or less of their
